import React from "react";

const HighScore = (props) => {
  return (
    <div className="parentDiv">
      <h1 className="h1">High Score per Country</h1>
      {console.log(props.scores.sort((a, b) => a.name.localeCompare(b.name)))}
      {props.scores}
    </div>
  );
};

export default HighScore;
